import React from 'react';
import './App.css';

function App() {
  return (
      <div id="siteWrapper">
          <div id="header">
              <div className="header-inner">
                  <div className="logoWrapper">
                      <h1 className="logoImage">
                          <a href="/">
                              <img alt="Cecilia Castillo" src={"./images/LogoWithoutBackground.jpg.bmp"} />
                          </a>
                       </h1>
                  </div>
              </div>
              <div>
                  <img className="content-fill" alt="" src={"./images/cecistyle1.jpg"} />
              </div>
          </div>
      </div>
  );
}

export default App;
